import styles from "./app.module.css";
import { data } from "../../utils/data";
import Header from "../Header/Header";

function App() {
  return (
    <div>
      <div className={styles.app}>
        <pre
          style={{
            margin: "auto",
            fontSize: "1.5rem",
          }}
        >
          Начало работы
        </pre>
      </div>
      <Header />;
    </div>
  );
}

export default App;
